<>
<div>
  <div>Indexes</div>
  <div class="prova">
    {cardsData.map((data, key) => {
      return (
        <div key={key}>
          <Card name={data.name} textfront={data.textfront} textback={data.textback} />
        </div>
      );
    })}
  </div>
</div>
</>

function CardsContainer(props) {
  return (
    <>
    <div>
      <div>Indexes</div>
      <div class="prova">
        {props.cardsdata.map((data, key) => {
          return (
            <div key={key}>
              <Card name={data.name} textfront={data.textfront} textback={data.textback} />
            </div>
          );
        })}
      </div>
    </div>
    </>
  )
};

export default CardsContainer;
